import Home from "./pages/Home";
import Cart from "./pages/Cart";

function App() {
  return (
    <BrowserRouter>
      <NavBar />
      <div className="App">
        <Routes>
          <Route path="/" exact element={ <Home />}>

          </Route>
          <Route path="/cart" element={ <Cart /> }>

          </Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
